  \"effects-of-proposed-water-control-structure-at-prime-hook-national-wildlife-refuge-1981\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The United States Fish and Wildlife Service
  is studying the feasibility of constructing a water control structure on the Prime
  Hook National Wildlife Refuge. The structure would hold about six inches of water
  on the refuge for wildlife from October to March each year. This effort will help
  to determine any effects this water might have on existing utilities such as water
  supply wells, septic tanks and tile fields, and any underground utilities that may
  exist at present or be planned for the future.\",\n\t\"license_title\": \"License
